import styled from "styled-components";
import { Voice } from "./Main";

const StyledVoiceList = styled.div`
  th {
    border-bottom: 2px solid black;
    padding-bottom: 15px;
  }
  td {
    padding: 15px 0;
    border-bottom: 1px solid black;
  }
  table {
    margin-top: 1rem;
    width: 100%;
  }
  td {
    text-align: center;
  }
  button {
    background-color: white;
    border: none;
  }
`;

const VoiceList = ({ voices }: { voices: Voice[] }) => {
  return (
    <StyledVoiceList>
      <table>
        <tr>
          <th>번호</th>
          <th>작성날짜</th>
          <th>제목</th>
          <th>언어</th>
          <th>다운로드</th>
        </tr>

        {voices.map((voice: Voice) => (
          <tr>
            <td>{voice.id}</td>
            <td>{voice.createdDate}</td>
            <td>{voice.title}</td>
            <td>{voice.lang}</td>
            <td>
              <img src={"/icon/file.svg"} alt={"file"} />
            </td>
            <br />
          </tr>
        ))}
      </table>
    </StyledVoiceList>
  );
};
export default VoiceList;
